select 'DOUBLE BOGEY' into retResult;
when 3 then
select 'TRIPLE BOGEY' into retResult;
when 4 then
select '4 OVER PAR' into retResult;
else
select case varStrokes 
when 1 then 'TEE SHOT'
when 2 then '2nd SHOT' 
end into retResult;

end case;

end case;


RETURN retResult;

END ;;
